export const menuItems = {
  page_size: 10,
  next: 2,
  prev: null,
  data: [
    {
      name: "Cat 1",
    },
    {
      name: "Cat 2",
      right: [
        {
          name: "Cat 2 Sub 1",
          right: [
            {
              name: "Cat 2 Sub 1 SubSub 1",
              right: [
                {
                  name: "Cat 2 Sub 1 SubSub 1",
                },
              ],
            },
          ],
        },
        {
          name: "Cat 2 Sub 2",
        },
      ],
    },
    {
      name: "Cat 3",
    },
  ],
};
